//Write a program to check if the two numbers 23 and 45 are equal.
public class equal {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=23;
		int b=45;
		if (a==b)
		{
			System.out.println("both are equal");
		}
		else
			System.out.println("both are different");

	}

}
